import React from "react";
import {useState} from "react";
import GetUserInput from "./GetUserInput";



function UserPage(){
    var County;
    var datetime;


    const [message, setMessage] = useState('');


    function handleSubmit(e){
        console.log("you click the button");
    }


    const handleCountyChange = event => {
        setMessage(event.target.value);
            County = event.target.value
        console.log('value is:', County);
      };

    const handleDateChange = event => {
        setMessage(event.target.value);
            datetime = event.target.value
        console.log('value is:', datetime);
      };

    const handleTempChange = event => {
        setMessage(event.target.value);
            datetime = event.target.value
        console.log('value is:', datetime);
      };


    return (
        <div>
            <h1>Hi this is a wildfire prediction</h1>
            <label>County: </label>
            <input 
                type="text" 
                id ="County" 
                name ="County" 
                onChange={handleCountyChange}
                value={message}
                placeholder="Enter County">
            </input>
            <br></br>
            <label>Date: </label>
            <input 
                type="date" 
                name="datetime"
                onChange={handleDateChange}
                value={message}
            ></input>
            <br></br>
            <label>Temp: </label>
            <input 
                type="float" 
                name="temp" 
                onChange={handleDateChange}
                value={message}
                placeholder="Enter Temp in Celius">
            </input>
            <br></br>
            <label>Hum: </label>
            <input type="float" name="Hum" placeholder="Enter Hum in %"></input>
            <br></br>
            <button type="button" name= "submit" onClick={handleSubmit}>Sumbit</button>
        </div>
    );
}

export default UserPage;
